import { Helmet } from 'react-helmet';
import ClockLogic from './Clock25+5/Clock';
import './App.css';

function App() {
  return (
    <div className="App">

      <ClockLogic />
      <Helmet>
        <script src='https://cdn.freecodecamp.org/testable-projects-fcc/v1/bundle.js'></script>
      </Helmet>
    </div>
  );
}

export default App;
